import React from 'react';
import './styles.css';

const Footer = () => (
  <footer className="footer">
    <div className="footer-container">
      <p>Desenvolviod por </p>
      <span> Thiago Henrique Domingues </span>
    </div>
  </footer>
);

export default Footer;
